find_minimal_value_path(Matrix, Path) ->
	%%io:format("Path:~w~n",[Path]),
	{X, Y, _Value} = lists:last(Path),
	case (X == 80) and (Y == 80) of
		true -> Path;
		false ->
			case (X == 80) and (Y < 80) of
				true ->
					ToEndCells = lists:filter(fun({V,W,_Value1})-> (V == X) and (W > Y) end, Matrix),				
					find_minimal_value_path(Matrix,lists:flatten([Path|ToEndCells]));
				false ->
					case (Y == 80) and (X < 80) of
						true ->
							ToEndCells = lists:filter(fun({V,W,_Value1})-> (W == Y) and (V > X) end, Matrix),				
							find_minimal_value_path(Matrix,lists:flatten([Path|ToEndCells]));		
						false ->
							[{Xr, Yr, Vr}] = lists:filter(fun({V,W,_Value1})-> (V == X) and (W == Y + 1) end, Matrix),
							[{Xd, Yd, Vd}] = lists:filter(fun({V,W,_Value1})-> (V == X+1) and (W == Y) end, Matrix),
							MinCell = case Vr < Vd of true -> {Xr, Yr, Vr}; false -> {Xd, Yd, Vd} end,
							find_minimal_value_path(Matrix,lists:flatten([Path|[MinCell]]))
					end
			end
	end.